import React from 'react'

class StoryMetadataBtn extends React.Component {
  render() {
    const { filterItem, toggleFilter, type } = this.props

    return (
      <button onClick={() => toggleFilter(filterItem, type)}>{filterItem}</button>
    )
  }
}

export default StoryMetadataBtn
